import React from 'react'
import ReactDOM from 'react-dom'
import styled from 'styled-components'
import withRouter from 'react-router-dom/withRouter'



const Wrapper = styled.section `
    height:100%
    overflow:scroll;
`
const InnerWrapper = styled.div `
overflow:scroll;
    text-align: center;
    color:red;
`
class LandingContentComponent extends React.Component {

  render() {
    return (

        <Wrapper>



         <InnerWrapper>
             Hi
         </InnerWrapper>

        </Wrapper>

    )
  }
}

export default withRouter(LandingContentComponent);
